@import 'test';
@import url('https://fonts.googleapis.com/css2?family=DM+Sans:wght@400;500;700&display=swap');

$primary-bg: #901C1C;
$secondary-bg: #D3573C;
$secondary-dark-color: #525252;
$secondary-dark-bg: #FAFAFA;

*{
    padding: 0px;
    margin: 0px;
    box-sizing: border-box;
    font-family: 'DM Sans';
}
// HEADER
header {
    padding: 20px 0px;
    display: flex;
    flex-flow: row wrap;
    justify-content: space-around;
    align-items: center;
    width: 70%;
    img{
        padding: 10px;
        width: 200px;
    }
    nav {
        width: 490px;
        padding: 20px;
        margin-left: 20px;
        display: flex;
        flex-flow: row wrap;
        justify-content: center;
        align-items: center;
        a{
            text-align: center;
            font-size: 12px;
            border: 0.5px solid $secondary-dark-bg;
            border-radius:11px;
            padding: 1px 6px;
            color: $primary-bg;
            margin: 0px 3px;
            text-decoration: none;
            width: fit-content; 
            border: 0.5px solid #C4C4C4;
            box-sizing: border-box;
            border-radius: 11px;
            transition: all 0.2s;
            -webkit-transition: all 0.2s;
            -moz-transition: all 0.2s;
            -ms-transition: all 0.2s;
            -o-transition: all 0.2s;
            &:hover{
                background-color: #901C1C;
                color: #fff;
            }
        }   
    }
}
@media (max-width: 1050px) {
    header {
        width: 100%;
        flex-flow: column nowrap;
        align-items: flex-start;
        img {
            width: 150px;
        }
        nav {
            width: 340px;
            margin: 0 auto;
            align-self: center;
            
        }
    }
}
@media (max-width: 310px) {
    header {
        img {
            width: 100px;
        }
        nav {
            width: 100%;
        }
    }
}


// MAIN 
main {
    h1 {
        position: absolute;
        top: 0;
        right: 20px;
        font-size: 36px;
        width: fit-content;
        color: $primary-bg;
        font-family: 'DM Sans', sans-serif;
    }
    section {
        display: flex;
        flex-flow: row wrap;
        width: 100%;
        .cards {
            width: 100%;
            display: flex;
            flex-flow: row wrap;
            justify-content: center;
            align-items: center;
            .card {
                padding: 20px 0px;
                // background-color: #1a8375;
                line-height: 20px;
                width: 500px;
                display: flex;
                flex-flow: column nowrap;
                align-items: center;
                margin: 0 auto;
                a{
                    text-align: center;
                    text-decoration: none;
                    img{
                        margin: 15px 0px;
                        background: #C4C4C4;
                        box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.25);
                        border-radius: 50%;
                        width: 300px;
                        height: 300px;
                        -webkit-border-radius: 50%;
                        -moz-border-radius: 50%;
                        -ms-border-radius: 50%;
                        -o-border-radius: 50%;
    }
                    h2{
                        color: $secondary-bg;
                        line-height: normal;
                        font-size: 36px;
                        padding: 20px 0px;
                    }
                }
                p:nth-of-type(1) {
                    font-size: 13px;
                    color: $primary-bg;
                }
                p:nth-of-type(2) {
                    font-weight: 400;
                    font-size: 10px;
                }
                p:nth-of-type(3) {
                    line-height: 11,72px;
                    font-size: 9px;
                    color: #757575;
                }
                .tags {
                    width: fit-content;
                    display: flex;
                    flex-flow: row wrap;
                    justify-content: center;
                    align-items: center;
                    a {
                        text-decoration: none;
                        color: $primary-bg;
                        font-weight: 500;
                        margin: 2px;
                        padding: 1px 6px;
                        line-height: 15.62px;
                        border: 0.5px solid #C4C4C4;
                        box-sizing: border-box;
                        border-radius: 11px;
                        -webkit-border-radius: 11px;
                        -moz-border-radius: 11px;
                        -ms-border-radius: 11px;
                        -o-border-radius: 11px;
                        transition: all 0.2s;
                        -webkit-transition: all 0.2s;
                        -moz-transition: all 0.2s;
                        -ms-transition: all 0.2s;
                        -o-transition: all 0.2s;
                        font-size: 12px;
                        &:hover{
                        background-color: #901C1C;
                        color: #fff;
                        }
                    }
                    
                    
    }
            }

        }
    }
}
@media (max-width: 1010px) {
    main {
        h1{
            width: fit-content;
            font-size: 18px;
            top: 34px;
            right: 10px;
        }
    }
}
@media (max-width: 310px) {
    main {
        h1 {
            top: 30px;
            font-size: 16px;
            right: 5px;
        }
    }
}


.result {
    width: 100%;
    height: 50vh;
}

li {
    border-radius: 5px;
    width: fit-content;
    border: 3px solid red;
    -webkit-border-radius: 5px;
    -moz-border-radius: 5px;
    -ms-border-radius: 5px;
    -o-border-radius: 5px;
}
